import { PropaneSharp } from "@mui/icons-material";
import {  Avatar, Typography, Box, TextField } from "@mui/material";
import { useState } from "react";

const InfoTitle = (props) => {
  const queryClient = useQueryClient();
  const mutation = useMutation(data => {
    return axios.get('/companys/memo/append', data);
  }, {
    onSuccess: () => { queryClient.invalidateQueries("companys"); }
  });

  return (
    <Box
      sx={{
        margin: "20px",
        display: "flex",
        color: "#919294",
        fontWeight: 600,
        fontSize: "12px",
        lineHeight: "140%",
        justifyContent: "space-between",
      }}
      fullwidth
    >
      <Avatar sx={{ height: "64px", width: "64px" }} variant="rounded" />
      <Box>
        <Typography sx={{ mb: "7px", fontSize: "12px", fontWeight: 600 }}>
          업체 등록일
        </Typography>
          <TextField
            variant="standard"
            id="date"
            type="date"
            defaultValue={props.data.createdAt}
          />
      </Box>
    </Box>
  );
};

export default InfoTitle;
